import axios from "axios";

const ApiRequest = {
  Session: {
    Login: async (params) => {
        try {
          await axios.post('https://dev.perseo.tv/ws/Login.php', {
              params: {
                user: 'sdf',
                pass: 'dsf',
                device: 'web'
              },
              headers: {
                  'Accept': 'application/json',
                  'Content-Type': 'application/x-www-form-urlencoded',
              },
            })
            .then(res => {
              console.log(res);
              return res;              

            });
        } catch (err) {
          console.log(err)
        }
    }
  }
}

export default ApiRequest;
